async function fetch_finish_page(form) {
        let formData = new URLSearchParams(new FormData(form)); // https://stackoverflow.com/a/46642899
        let finishPage = await fetch("https://jpdb.io/review#a", {
                method: "POST",
                headers: {
                        "Content-Type": "application/x-www-form-urlencoded",
                },
                body: formData
        })
        if (finishPage.ok) {
                return await finishPage.text();
        } else {
                throw new Error("Something went wrong.");
        }
}

function injectFinishPage(html) {
        document.write(html);
        finishFeedback.insert();
        document.querySelector(
                "input[value='Yes, keep going!']"
        ).addEventListener("click", () => {
                cardsDoneThisSession.reset();
        });
}

let userClickedButton;
let finishPage;

async function checkIfFinished(event) {
        if (cardsDoneThisSession.count == localStorage.getItem("cardsPerSession")) {
                finishPage = await fetch_finish_page(event.target.parentNode);
                setTimeout(() => {
                        injectFinishPage(finishPage);
                }, 1100)
        } else {
                userClickedButton = event.target.id;
                setTimeout(() => {
                        document.getElementById(userClickedButton).click();
                }, 1100)
        }
}

/* POP-UPS AFTER ANSWERING */
class AnswerPopup {
        constructor(grade) {
                this.grade = grade;
                this.popup = `<pop-up class="cardfinish${this.grade}">${this.message}</pop-up>`;
                this.audio = this.grade <= 2 ? audioSources.wrong : audioSources.correct;
        }
        get message() {
                let messages = [
                        null,
                        "Next time!",
                        "Almost!",
                        "Tough one!",
                        "Nice :)",
                        "Wow!",
                        "Bye-bye!",
                        "Wonderful!"
                ];
                return messages[this.grade]
        }
        insert() {
                document.body.innerHTML += this.popup;
                new Audio(this.audio).play();
        }
        handleEvent(event) {
                event.preventDefault();
                this.insert();
                progressBar.update();
        }
}

function createAnswerPopups() {
        let answerPopups = [null];
        for (let i = 1; i <= 7; i++) { // Because there are 7 possible grade buttons
                answerPopups[i] = new AnswerPopup(i);
        }
        return answerPopups;
}

/* COUNTS NUMBER OF CARDS PER SESSION */
async function fetch_settings() {
        let settings = await fetch("https://jpdb.io/settings");
        if (settings.ok) {
                settings = new DOMParser().parseFromString(
                        await settings.text(),
                        "text/html"
                );
        }
        return settings;
}

async function fetch_cards_per_session_count() {
        let settings;
        if (window.location.href == "https://jpdb.io/settings") {
                settings = document;
        } else {
                settings = await fetch_settings();
        }
        let count = settings.getElementById("cards-per-review-session").value;
        localStorage.setItem("cardsPerSession", count);
}

/* COUNTS NUMBER OF CARDS DONE THIS SESSION */
const cardsDoneThisSession = {
        handleEvent: function (event) {
                this.increase();
        },
        get count() {
                return parseInt(localStorage.getItem("cardsDoneThisSession"));
        },
        reset: function () {
                localStorage.setItem("cardsDoneThisSession", 0);
        },
        watch: function (currentPage) {
                if (!this.count || isNaN(this.count) || this.count >= localStorage.getItem("cardsPerSession") || (this.count !== 0 && currentPage !== "review")) {
                        this.reset();
                        // alert("Cards done this session reset.")
                }
                // alert("Cards done this session: " + cardsDoneThisSession.count);
        },
        increase: function () {
                localStorage.setItem("cardsDoneThisSession", parseInt(this.count + 1));
        }
}

/* PROGRESS BAR */
const progressBar = {
        current: Math.round(cardsDoneThisSession.count / localStorage.getItem("cardsPerSession") * 100),
        next: Math.round((cardsDoneThisSession.count + 1) / localStorage.getItem("cardsPerSession") * 100),
        html: `<progress-bar></progress-bar>`,
        get css() {
                let css = `
<style>
progress-bar {
  background: var(--outline-input-color);
  width: ${this.current}%;
  height: 0.5rem;
  display: block;
}

@keyframes increase {
  to {
    width: ${this.next}%
  }
}
</style>
                `
                return css; 
        },
        insert: function () {
                document.head.innerHTML += this.css;
                document.body.insertAdjacentHTML("afterbegin", this.html);
        },
        update: function () {
                let bar = document.querySelector("progress-bar");
                bar.style.animation = "increase 0.5s";
                bar.style.animationFillMode = "forwards";
                
        }
}

